import React from "react";
import './nav.css'

const Navbar = () => {
  return (
    <header className="header">
      <a href="/logo" className="logo"><b>
        Logo
        </b>
      </a>

      <nav className="navbar">
        <a href="/home">Home</a>
        <a href="/about">About</a>
        <a href="/portfolio">Portfolio</a>
        <a href="/">Services</a>
        <a href="/">Contact</a>
      </nav>
    </header>
  );
};

export default Navbar;
